🇺🇦 ⚡️ С этой минуты в Украине введено ЧП. Степень вводимых мер будут определять региональные власти:

• ЧП введут по всей стране, кроме Донецкой и Луганской областей, где с 2014 года действует особое положение;

• будут запрещены массовые мероприятия;

• может быть введён комендантский час;

• призывники, военнообязанные и резервисты не могут переезжать с места жительства без уведомления властей;

• будет установлен особый режим въезда и выезда в страну;

• возможно прекращение работы аэропортов;

• при необходимости будут организованы личные досмотры, ограничено движение машин, усилена охрана общественного порядка и объектов критической инфраструктуры;

• может проводиться временная или безвозвратная эвакуация населения — с предоставлением альтернативного жилья;

• запрещается распространение «дестабилизирующей обстановку» информации;

• запрещается делать любительские радиопередатчики для личного и коллективного пользования;

• возможно особое регулирование связи и интернета. Возможен запрет на работу мобильных телефонов.

