🧳 заморозка активов и запрет на въезд в Евросоюз 351 депутату Госдумы;

💸 санкции против 27 физлиц и организаций, в числе которых политики, военные, банки и предприниматели, «сыгравшие роль в подрыве территориальной целостности Украины»;

🛒 запрет на импорт из ДНР и ЛНР и на экспорт туда определенных товаров и технологий, ограничения на торговлю и инвестиции, запрет на организацию туризма;

💷 ограничения на доступ России к рынку капитала и финансовому рынку ЕС, запрет финансировать Российскую Федерацию, её правительство и центробанк.

